&lt;p style=&quot;text-align: center; &quot;&gt;&lt;b&gt;KEDUDUKAN,ORGANISASI,TATA KERJA DAN URAIAN TUGAS POKOK DAN FUNGSI DINAS PENDIDIKAN
    &lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center; &quot;&gt;&lt;b&gt;
        Bagian Kesatu
    &lt;/b&gt;&lt;/p&gt;
