        KEDUDUKAN
    &lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center; &quot;&gt;&lt;b&gt;
        Pasal 76
    &lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (1)&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Dinas Pendidikan dipimpin oleh Kepada Dinas yang berada di
        bawah dan bertanggung jawab kepada Bupati melalui Sekretaris Daerah ;
    &lt;/span&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;
        (2) Dinas Pendidikan mempunyai tugas melaksanakan Urusan Pemerintah Daerah berdasarkan Azas Otonomi dan
        Manajemen terkait Kewenangan dibidang Pendidikan ;
    &lt;/span&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;
        (3) Untuk menyelenggarakan tugas sebagaimana dimaksud Dinas Pendidikan mempunyai fungsi ; &lt;/span&gt;&lt;/p&gt;
&lt;ol type=&quot;a&quot;&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Perumusan Kebijakan Teknis dibidang
            Pendidikan ; &lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Penyelenggaraan,Pengawasan,Proses
            Pemberian Rekomendasi Perizinan dan Pelaksanaan Pelanyanan Umum di Bidang Pendidikan ; &lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Pembinaan terhadap Unit Pelaksana
            Teknis dibidang Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Pengelolaan Urusan Ketatausahaan
            Dinas ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Melaksanakan Koordinasi Penyusunan
            Perencanaan Pembangunan Daerah ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt; Melaksanaan Pengendalian,Evaluasi
            Pembangunan,Penelitian dan Pengembangan Ekonomi,Sosial,Budaya,Tata Ruang dan Prasarana Daerah ; &lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;text-align: center; font-size: 1rem;&quot;&gt;Pembinaan dan Pelaksanaan tugas
            dibidang Pendidikan untuk Perencanaan Pembangunan Daerah Sesuai dengan tugas dan fungsinya&lt;/span&gt;&lt;/li&gt;
&lt;/ol&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;Bagian Kedua&lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;&lt;b&gt;ORGANISASI&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;&lt;b&gt;Pasal 77&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;(1) Susunan Organisasi Dinas Pendidikan,terdiri dari
        :&lt;/span&gt;&lt;/p&gt;
&lt;ol&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Dinas&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Sekretariat,membawahi : &lt;ol type=&quot;a&quot;&gt;
                &lt;li&gt;Sub Bagian Umum dan Tugas Perbantuan,&lt;/li&gt;
                &lt;li&gt;Sub kordinator Bagian Program,&lt;/li&gt;
                &lt;li&gt;Perencanaan dan Pelaporan,&lt;/li&gt;
                &lt;li&gt;Sub kordinator Bagian Keuangan.&lt;/li&gt;
            &lt;/ol&gt;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Bidang Pembinaan SD,menbawahi :&lt;ol type=&quot;a&quot;&gt;
                &lt;li&gt; Seksi Kurikulum dan Penilian SD,&lt;/li&gt;
                &lt;li&gt;Seksi Kelembagaan dan Sarana Prasarana SD,&lt;/li&gt;
                &lt;li&gt;Sub kordiator Peserta Didik dan Pembangunan Karakter SD.&lt;/li&gt;
            &lt;/ol&gt;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Bidang Pembinaan Pendidikan Anak Usai Dini dan
            Pendidikan Nonformal,membawahi :&lt;ol type=&quot;a&quot;&gt;
                &lt;li&gt;Seksi kurikulum dan Penilaian PAUD dan Pendidikan Nonformal,&lt;/li&gt;
                &lt;li&gt;Seksi Kelembagaan,dan Sarana Prasarana PAUD dan Pendidikan Nonformal,&lt;/li&gt;
                &lt;li&gt;Sub kordinator Peserta Didik dan Pembangunan karakter PAUD dan Pendidikan Nonformal.&lt;/li&gt;
            &lt;/ol&gt;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Bidang pembinaan Ketenagaan&lt;ol type=&quot;a&quot;&gt;
                &lt;li&gt;Sub kordinator Pembinaan PTK Paud dan Pendidikan Non Formal, &lt;/li&gt;
                &lt;li&gt;Seksi Pembinaan PTK SD, &lt;/li&gt;
                &lt;li&gt;Seksi Pembinaan PTK SMP.&lt;/li&gt;
            &lt;/ol&gt;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Bidang Pembinaan SMP&lt;ol type=&quot;a&quot;&gt;
                &lt;li&gt;Seksi Kurikulum dan Penilaian SMP&lt;/li&gt;
                &lt;li&gt;Seksi Kelembagaan dan Sarana Prasarana SMP&amp;nbsp;&lt;/li&gt;
                &lt;li&gt;Sub kordinator Peserta Didik dan Pembangunan Karakter SMP&lt;br&gt;&lt;/li&gt;
            &lt;/ol&gt;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Unit Pelaksana Teknis Dinas
    &lt;/li&gt;
&lt;/ol&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;


        Bagian Ketiga&lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;URAIAN TUGAS POKOK DAN FUNGSI&lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;Pasal 78&lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;

    (1) Dinas Pendidikan dipimpin oleh Kepala Dinas yang berada di bawah dan bertanggungjawaban kepala Bupati
    melalui Sekretaris daerah ;
&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (2) Kepala Dinas Pendidikan mempunyai tugas melaksanakan Urusan Pemerintah Daerah berdasarkan Azas Otonomi dan
    Manajemen terkait Kewenangan dibidang Pendidikan ;
&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (3) Untuk menyenggarakan tugas sebagaimana dimaksud Kepala Dinas Pendidikan mempunyai fungsi :&lt;/p&gt;
&lt;ol type=&quot;a&quot;&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Membantu Bupati dalam melaksanakan tugas Otonomi dalam
            penyelenggaraan Pemerintah

            Kabupaten dibidang Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Penyiapan Konsep Kebijakan Dinas dalam Pelaksanaan
            tugas – tugas dinas dibidang

            pendidikan;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Merumuskan Sasaran dan Program Kerja dibidang
            Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Merumuskan Petunjuk Pelaksanaan dan Petunjuk Tekhnis
            sebagai Dasar Pelaksanaan tugas

            Dinas Pendidikan sesuai dengan Perundang – undangan yang berlaku ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Menetapkan Program Kerja Dinas Pendidikan sesuai dengan
            Rencana Strategi Pemerintah

            Kabupaten Padang Lawas Utara ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt; Mengendalikan dan Mengarahkan Pelaksanaan tugas
            Sekretaris dan Bidang;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Mengoreksi dan menandatangani surat – surat untuk
            ditanda tangani Bupati ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Merumuskan Kebijakan dan solusi Pemecahan terhadap
            masalah – masalah Pelaksanaan

            tugas Dinas Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Mendistribusikan tugas kepada para bawahan;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Mengadakan Konsultasi tugas dengan pihak – pihak yang
            terkait baik Tekhnis maupun

            Administrasi,untuk Keserasian dan Keharmonisan pelaksanaan Tugas Pokok dan Fungsi ; &lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Melaksanakan Pembinaan,Pengawasan,Penegakan
            Disiplin,serta Penilaian kinerja terhadap bawahan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Memberikan Saran dan Pertimbangan yang perlu kepada
            Bupati melalui Sekretaris Daerah sesuai bidang tugas dan
            fungsinya ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt; Pelaporan dan Pertanggungjawaban pelaksanaan tugas dan
            fungsinya kepada Bupati melalui Sekretaris Daerah ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Melaksanakan Penyelenggarakan dan Pengawasan Akreditasi
            Lembaga Pendidikan dan Sertifikasi Tenaga Pendidikan
            dan Kependidikan secara Profesional serta sesuai Persyaratan jabatan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Melaksanakan Penyelesaian Perizinan dibidang Pendidikan
            ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Melaksanakan Penyelenggaraan Kelender dan Jumlah
            Belajar Efektif setiap tahun bagi Jenjang Pendidikan Anak
            Usai Dini,Pendidikan Masyarakat sampai Jenjang Pendidikan Dasar.&lt;/span&gt;&lt;/li&gt;
&lt;/ol&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;
    &lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;b&gt;Pasal 79
    &lt;/b&gt;&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (1) Sekretariat dipimpin oleh seorang Sekretaris Sebagai Pejabat Administrator yang dalam melaksanakan tugas dan
    fungsi berkedudukan dibawah dan bertanggung jawab kepada Kepala Dinas;
&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (2) Sekretaris mempunyai tugas membantu Kepala Dinas dalam menyelenggarakan tugas kelencaran pelaksanaan fungsi
    Kepala Dinas dalam Bidang penyelenggaraan urusan pemerintahan bidang Pendidikan dan pelayanan
    umum,kepegawaian,tata usaha,rumah tangga dan teknis penyelenggaraan pelaksanaan tugas pokok Dinas;
&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (3) Sekretaris Dinas,mempunyai fungsi :&lt;/p&gt;
&lt;ol type=&quot;a&quot;&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Memimpin sekretariat dalam pelaksanaan kegiatan peralatan,penataan arsip,kepegawaian
        dan penatausahaan
        keungan dan barang,Pengololaan informasi serta penyusunan program dan evaluasi pelaksanaan tugas fungsi Satuan
        Kerja;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Menghimpun dan mempelajari peraturan perundung – undangan ,pedoman dan petunjuk teknis
        serta bahan – bahan
        lainya yang berhubungan dengan pelaksanaan kegiatan teknis administrasi umum,perlengkapan dan peralatan,penataan
        arsip,kepegawaian dan penata usahaan keuangan dan barang serta Pengelolaan informasi Satuan Kerja berbasis
        elektronik;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Menyusunan rencana kerja operasional secretariat berdasarkan program,kegiatan dan
        sasaran yang telah
        ditetapkan sebagai pedoman pelaksanaan tugas;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Memfasilitasi dan Mengkordinir Penyusunan dokumen perencanaan.&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Mengkoordinir penyusunan kebutuhan anggaran kas Satuan Kerja; &lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Membuat rencana kerja berdasarkan peraturan yang berlaku untuk pedoman pelaksanaan
        tugas; &lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Mendistribusikan Tugas kepala bawahan sesuai bidang masing – masing ; &lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Mengkoordinasikan pelaksanaan Tugas Bidang – Bidang ;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Membina dan Memotivasi bawahan dalam upaya peningkatan produktivitas pelaksanaan tugas
        dan pengembangan
        karier;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Mengatur pendistribusian surat masuk dan surat keluar; &lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Mengkoordinasikan kegiatan pelayanan administrasi ketatausahaan sesuai kebutuhan unit
        kerja agar kegiatan
        pokok dapat terlaksana dengan lancer;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;Mengendalikan pelaksanaan kegiatan perencanaan :&lt;ol type=&quot;a&quot;&gt;
            &lt;li&gt;Sub Bagian Umum dan Tugas Perbantuan.&lt;/li&gt;
            &lt;li&gt;Sub Bagian Program,Perencanaan dan Pelaporan.

                c. Sub Bagian Keuangan.&lt;/li&gt;
        &lt;/ol&gt;
    &lt;/li&gt;
&lt;/ol&gt;
&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-weight: bolder;&quot;&gt;Pasal 80&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;(1) Sub Bagian Umum dan Tugas Perbantuan dipimpin oleh seorang Kepala Sub Bagian
        sebagai pejabat pengawas yang
        dalam melaksanakan tugas dan fungsinya berkedudukan di bawah dan Kepegawaian dan bertanggungjawab kepala
        Sekretaris.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;(2) Kepala Sub Bagian Umum dan Tugas Perbantuan mempuanyai tugas melaksanakan sebagian
        tugas kesekretariatan
        khususnya urusan umum.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;(3) Kepala Sub Bagian Umum dan Tugas Perbantuan memfunyai fungsi :&lt;/span&gt;&lt;/p&gt;
&lt;span style=&quot;font-size: 1rem;&quot;&gt;
    &lt;ol type=&quot;a&quot;&gt;
        &lt;li&gt;Memimpin sub bagian umum dalam pelaksanaan teknis administrasi umum,perlengkapan,peralatan,penataan
            arsip dan kepegawaian;&lt;/li&gt;
        &lt;li&gt;Menghimpun dan mempelajari peraturan perundang – undangan,pedoman dan petunjuk teknis serta bahan –
            bahan lainya yang berhubungan dengan pelaksanaan kagiatan teknis administrasi
            umum,perlengkapan,peralatan penataan arsip dan kepegawaian ;&lt;/li&gt;
        &lt;li&gt;Menyusun rencana kerja operasional sub bagian umum dan kepegawaian berdasarkan program,kegiatan dan
            sasaran
            yang telah ditetapkan sebagai pedoman pelaksanaan tugas ;&lt;/li&gt;
        &lt;li&gt; Menyelenggarakan pelayanan administrasi umum,kepegawaian perlengkapan dan

            perpustakaan ;&lt;/li&gt;
        &lt;li&gt; Melaksanakan Pengelolaan Imformasi Perangkat Daerah ;&lt;/li&gt;
        &lt;li&gt;Melakuakan inventarisasi,pengadaan,mengelola dan memelihara serta mengamankan alat – alat
            perlengkapam kantor
            dan perpustakaan;&lt;/li&gt;
        &lt;li&gt;Melakukan koordinasi dengan unit kerja terkait baik internal maupun eksternal;&lt;/li&gt;
        &lt;li&gt;Mengatur pendistribusian surat masuk dan keluar sesuai permasalahannya,agar penyampaian surat
            ketujuan tepat
            waktu;&lt;/li&gt;
        &lt;li&gt; Mengkoordinasikan kegiatan pelayanan administrasi ketatausahaan dan perjalanan dinas sesuai
            kebutuhan agar
            kegiatan dapat berjalan lancer;&lt;/li&gt;
        &lt;li&gt; Mengkoordinir kegiatan pelayanan kerumahtanggaan dan keprotokolan sesuai rencana kebutuhan masing –
            masing
            unit pelaksanaan tugas;&lt;/li&gt;
        &lt;li&gt;Mengumpulkan dan mengolah data yang berhubungan dengan kepegawaian; &lt;/li&gt;
        &lt;li&gt;Menyiapkan dan menyusun daftar rencana daftar urut kepangkatan (DUK) dan analisis jabatan; &lt;/li&gt;
        &lt;li&gt;Menyiapkan data dan bahan perlengkapan untuk pengusulan dan pengangkatan dalam jabatan; &lt;/li&gt;
        &lt;li&gt;Menyelesaikan temuan hasil pemeriksaan pengawas fungsional; &lt;/li&gt;
        &lt;li&gt;Membina dan memotivasi bawahan dalam upaya peningkatan produktivitas pelaksanaan tugas dan
            pengembangan
            karier; &lt;/li&gt;
        &lt;li&gt;Menyiapkan laporan pelaksanaan tugas kepada atasan sebagai bahan pertanggungjawaban dan penyusunan
            program
            lanjutan; &lt;/li&gt;
        &lt;li&gt;Memimpin pejabat pelaksanaan dalam pelaksanaan tugas –tugas; &lt;/li&gt;
        &lt;li&gt;Melaksanaakn tugas lainya sesuai instruksi yang diberikan oleh atasan; &lt;/li&gt;
        &lt;li&gt;Mengolah dan menyajikan bahan data untukPenyelenggaraan Urusan Kesekretariatan,Administrasi Umum
            Kepegawaian
            dan Perlengkapan Dinas dan UPTD; &lt;/li&gt;
        &lt;li&gt;Melaksanakan Urusan Perlengkapan dan Invetaris Barang serta Kebutuhan Rumah Tangga Dinas dan UPTD;
        &lt;/li&gt;
        &lt;li&gt;Untuk Pengajuan dan Pengikutisertaan Pegawai dalam Pendidikan dan Pelatihan

            Kepegawaian,Kenaikan Gaji Berkala,Cuti,Mutasi Tugas/Jabatan,Pensiun,Kenaikan Pangkat maupun Hukuman
            Disiplin; &lt;/li&gt;
        &lt;li&gt;Mengkoordinir Pembuatan PAK (Penilaian Angka Kredit) berdasarkan DUPAK (Daftar Usulan Angka Kredit)
            bagi
            setiap Guru/Pengawas di seluruh sekolah Jenjang Pendidikan Dasar di jajaran Lingkungan Dinas melalui
            Tim Penilai
            Angka Kredit sebagai salah dasar pengusulan Kenaikan Pangkat Jabatan Fungsional Guru dan Pengawas;
        &lt;/li&gt;
        &lt;li&gt;Mengkoordinir Pembuatan Laporan Penilaian Kinerja PNS melalui Pembuatan Sasaran Kinerja Pegawai
            (SKP) setiap
            tahunannya; &lt;/li&gt;
        &lt;li&gt;Menyalurkan/Memberikan SK Kenaikan Pangkat,Kenaikan Berkala,PAK dan SK Pensiun kepada seluruh PNS di
            Lingkungan Kerja Dinas Pendidikan melalui Unit Pelaksana Tekhnis Dinas (UPTD) di seluruh Kecamatan
            untuk Jenjang
            Pendidikan Dasar dan Pendidikan Anak Usia Dini; &lt;/li&gt;
        &lt;li&gt;Koordinasi dengan instansi vertical terkait pelaksanaan Pendidikan Menegah Keatas dan Melaksanakan
            Koordinasi&lt;/li&gt;
    &lt;/ol&gt;
&lt;/span&gt;

