&lt;p style=&quot;text-align: left;&quot;&gt;

    (1) Dinas Pendidikan dipimpin oleh Kepala Dinas yang berada di bawah dan bertanggungjawaban kepala Bupati
    melalui Sekretaris daerah ;
&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (2) Kepala Dinas Pendidikan mempunyai tugas melaksanakan Urusan Pemerintah Daerah berdasarkan Azas Otonomi dan
    Manajemen terkait Kewenangan dibidang Pendidikan ;
&lt;/p&gt;
&lt;p style=&quot;text-align: left;&quot;&gt;
    (3) Untuk menyenggarakan tugas sebagaimana dimaksud Kepala Dinas Pendidikan mempunyai fungsi :&lt;/p&gt;
&lt;ol type=&quot;a&quot;&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Membantu Bupati dalam melaksanakan tugas Otonomi dalam
            penyelenggaraan Pemerintah

            Kabupaten dibidang Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Penyiapan Konsep Kebijakan Dinas dalam Pelaksanaan
            tugas – tugas dinas dibidang

            pendidikan;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Merumuskan Sasaran dan Program Kerja dibidang
            Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Merumuskan Petunjuk Pelaksanaan dan Petunjuk Tekhnis
            sebagai Dasar Pelaksanaan tugas

            Dinas Pendidikan sesuai dengan Perundang – undangan yang berlaku ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Menetapkan Program Kerja Dinas Pendidikan sesuai dengan
            Rencana Strategi Pemerintah

            Kabupaten Padang Lawas Utara ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt; Mengendalikan dan Mengarahkan Pelaksanaan tugas
            Sekretaris dan Bidang;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Mengoreksi dan menandatangani surat – surat untuk
            ditanda tangani Bupati ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Merumuskan Kebijakan dan solusi Pemecahan terhadap
            masalah – masalah Pelaksanaan

            tugas Dinas Pendidikan ;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Mendistribusikan tugas kepada para bawahan;&lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Mengadakan Konsultasi tugas dengan pihak – pihak yang
            terkait baik Tekhnis maupun

            Administrasi,untuk Keserasian dan Keharmonisan pelaksanaan Tugas Pokok dan Fungsi ; &lt;/span&gt;&lt;/li&gt;
    &lt;li style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Melaksanakan Pembinaan,Pengawasan,Penegakan
